    data: |
      SELECT DISTINCT - - MIN ( col0 ) * + COUNT ( * ) + + COUNT ( * ) + + COUNT ( * ) + - 31 * - 23 AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q11625.out
    data: |
      764
